import { ComponentFixture, TestBed } from '@angular/core/testing';

import { SearchCarComponent } from './search-car.component';
import { CustomerService } from '../../service/customer.service';
import { HttpClientTestingModule, HttpTestingController } from '@angular/common/http/testing';
import { ReactiveFormsModule } from '@angular/forms';
import { HttpParams } from '@angular/common/http';
describe('SearchCarComponent', () => {
  let component: SearchCarComponent;
  let fixture: ComponentFixture<SearchCarComponent>;
  let customerService:  CustomerService;
  let httpMock: HttpTestingController;
  beforeEach(() => {
    TestBed.configureTestingModule({
      imports: [HttpClientTestingModule, ReactiveFormsModule ],
      declarations: [SearchCarComponent],
      providers: [CustomerService]
    });

    customerService = TestBed.inject(CustomerService);
    httpMock = TestBed.inject(HttpTestingController );
    fixture = TestBed.createComponent(SearchCarComponent);
    component = fixture.componentInstance;
    fixture.detectChanges();
  });

  it('should show car for type (SUV) for given date if available', () => {
    const mockAvailableCars = [
      {
        "id": 4,
        "name": "X5 M",
        "brand": "BMW",
        "color": "Blue",
        "type": "SUV",
        "year": "2020",
        "transmission": "Manual",
        "price": 120,
        "image": "",
        "carDto": {
            "id": 4,
            "brand": "BMW",
            "color": "Blue",
            "name": "X5 M",
            "type": "SUV",
            "price": 120,
            "image": "",
            "returnedImage": null,
            "year": "2020",
            "transmission": "Manual"
        },
        "processedImg": "data:image/jpeg;base64,"
      }
    ];

    const params = new HttpParams()
    .set('type', 'SUV')
    .set('from', '2025-08-21T10:00:00')
    .set('to', '2025-08-22T10:00:00')

    // Try to reserve another SUV
    customerService.getAvailableCars('SUV', '2025-08-21T10:00:00', '2025-08-22T10:00:00').subscribe((res) =>{
      
      res.forEach(element => {
        expect(element.name).toBe("X5 M");
      });
      expect(res.length).toBe(1);
      expect(res).toEqual(mockAvailableCars);
    });

    const req = httpMock.expectOne('http://localhost:8080/api/customer/search?'+ params);
    expect(req.request.method).toBe('GET');
    req.flush(mockAvailableCars);
  });


  it('should show car for type (Van) for given date if not available', () => {
    const mockAvailableCars = [];
    const params = new HttpParams()
    .set('type', 'SUV')
    .set('from', '2025-08-01T10:00:00')
    .set('to', '2025-08-02T10:00:00')

    // Try to reserve another SUV
    customerService.getAvailableCars('SUV', '2025-08-01T10:00:00', '2025-08-02T10:00:00').subscribe((res) =>{
      expect(res.length).toBe(0);
      expect(res).toEqual(mockAvailableCars);
    });

    const req = httpMock.expectOne('http://localhost:8080/api/customer/search?'+ params);
    expect(req.request.method).toBe('GET');
    req.flush(mockAvailableCars);
  });

  it('should show car for type (Van) for given date if not available', () => {
    const mockAvailableCars = [];
    const params = new HttpParams()
    .set('type', 'Van')
    .set('from', '2025-08-21T10:00:00')
    .set('to', '2025-08-22T10:00:00')

    // Try to reserve another SUV
    customerService.getAvailableCars('Van', '2025-08-21T10:00:00', '2025-08-22T10:00:00').subscribe((res) =>{
      expect(res.length).toBe(0);
      expect(res).toEqual(mockAvailableCars);
    });

    const req = httpMock.expectOne('http://localhost:8080/api/customer/search?'+ params);
    expect(req.request.method).toBe('GET');
    req.flush(mockAvailableCars);
  });

});
